import Vue from 'vue';
import Vuetify from 'vuetify/lib/framework';

Vue.use(Vuetify);

export default new Vuetify({
    theme: {
        options: {
            customProperties: true,
        },
        themes: {
            dark: {
                primary: '#127475',
                secondary: '#ABFF4F',
                error: '#F2542D',
                info: '#08BDBD',
                success: '#29BF12',
                warning: '#FF9914',
                background: '#1E1E1E',
                background1: '#363636',
                background2: '#272727'
            },
            light: {
                primary: '#08BDBD',
                secondary: '#ABFF4F',
                error: '#F21B3F',
                info: '#08BDBD',
                success: '#29BF12',
                warning: '#FF9914',
                background: '#1E1E1E',
                background1: '#363636',
                background2: '#272727'
            },
        },
    },
});
